import { Stack } from "react-bootstrap";

import My_Card from './Card'

export default function Stack_card(props) {
    const Articles = props.articles.filter((_,i) => i % 3 === props.i_line )
    return (
        <Stack gap={4}>
            {Articles.map((obj,idx)=> 
                <My_Card obj={obj}/>
            )}
        </Stack>
    )
}
